import React from 'react';

const MyBook = React.forwardRef((props, ref) => {

  return (
    <div className='demoPage' ref={ref}>
      <h4>Título: </h4>
      <p>Sinopsis: </p>
      <p>Autor: </p>
      <div className='Container'>
          <iframe
            className='Iframe'
            title= 'Hola'
            src= 'www.app.co'
            frameborder="0"
            allowFullScreen="true">
          </iframe>
      </div>
    </div>
  );
});

export default MyBook;
